import React  from 'react';
import '../styles/TableTitle.css';
function TableTitle () {
  return (
      <div className="container">
          <div>Profile Image</div>
          <div>Name</div>
          <div>Phone Number</div>
          <div>Email</div>
          <div>Date of Birth</div>
      </div>
  )
}

export default TableTitle;
